// 실제 배포 URL
const prod = {
  url: {
    API_BASE_URL: 'http://localhost:8080',
  }
}

// 개발 서버 URL
const dev = {
  url: {
    API_BASE_URL: 'http://localhost:8080'
  }
}

export const config = process.env.NODE_ENV === 'development' ? dev : prod
